from PyQt4 import QtCore, QtGui
import base64

class HelpDialog(QtGui.QDialog):
    def __init__(self, *args):
        QtGui.QDialog.__init__(self, *args)
        self.resize(500, 500)
        self.setWindowTitle(u'Справка')
        self.gridLayout = QtGui.QGridLayout(self)
        self.gridLayout.setMargin(0)
        self.gridLayout.setSpacing(0)
        self.textEdit = QtGui.QTextEdit(self)
        self.textEdit.setTextInteractionFlags(QtCore.Qt.LinksAccessibleByKeyboard | QtCore.Qt.LinksAccessibleByMouse | QtCore.Qt.TextBrowserInteraction | QtCore.Qt.TextSelectableByKeyboard | QtCore.Qt.TextSelectableByMouse)
        data = base64.b64decode('')
        #self.textEdit.setHtml(u'<!DOCTYPE html>\n<html xmlns="http://www.w3.org/1999/xhtml">\n<head>\n<meta charset="utf-8" />\n<style>\n.center {\n\ttext-align: center;\n\tfont-weight: bold;\n}\n</style>\n</head>\n<body>\n<div class="center">Справка</div>\n</body>\n</html>')
        self.textEdit.setHtml(data.decode("cp1251"))
        self.gridLayout.addWidget(self.textEdit, 0, 0, 1, 1)

